import { Injectable } from '@angular/core';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

@Injectable({
  providedIn: 'root'
})
export class ImpresionService {

  constructor() { }

  imprimir(encabezado: string[], cuerpo: Array<any>, titulo: string, guardar?: boolean, imagenBase64?: { contenido: string, tipo: string }) {
    const doc = new jsPDF({
      orientation: "portrait",
      unit: "px",
      format: 'letter'
    });
    
    // Agregar imagen si se proporciona
    if (imagenBase64) {
      // Convertir Base64 a formato adecuado
      const imagenSrc = ``;
      doc.addImage(imagenSrc, imagenBase64.tipo.split('/')[1], 80, 10, 300, 100); // Ajusta las coordenadas y tamaño según sea necesario
    }
    
    // Establecer estilo del título
    doc.setFont("helvetica", "bold");
    doc.setFontSize(25);
    doc.setTextColor(0, 0, 250);  // Color azul

    doc.text(titulo, doc.internal.pageSize.width / 2, 25, { align: 'center' });
    autoTable(doc, {
      head: [encabezado],
      body: cuerpo,
      startY: 130
    });
    
    if (guardar) {
      const hoy = new Date();
      doc.save(hoy.getDate() + hoy.getMonth() + hoy.getFullYear() + hoy.getTime() + '.pdf');
    }
  }
}
